  \"2016-11-25T21:06:45.030404\",\n\t\"name\": \"national-teacher-and-principal-survey-2015-16\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The 2015-16 National Teacher and Principal
  Survey (NTPS) is a redesign of the Schools and Staffing Survey (SASS); SASS program
  data is available since 1987-88 at <http://nces.ed.gov/surveys/sass/dataproducts.asp>.
  NTPS <http://nces.ed.gov/surveys/ntps/> will replace SASS as one of the key sources
  of nationally representative data on a range of important education topics including
  out-of-field teaching, school decision making, professional development, teacher
  and principal evaluation, and career paths of educators and administrators. The
  repeated cross-sectional design of NTPS allows tracking of trends on these topics
  over time. The survey is conducted through a combination of online and paper questionnaires.
  The sample includes teachers, principals, and schools, and is nationally representative.\",\n\t\"license_title\":
